import{_ as l,c as i,o as e,a4 as r}from"./chunks/framework.7Uoh_YdQ.js";const b=JSON.parse('{"title":"国际人工智能产业联盟深圳中心","description":"","frontmatter":{"layout":"doc"},"headers":[],"relativePath":"guide/career/associations/shenzhen-international-ai.md","filePath":"guide/career/associations/shenzhen-international-ai.md"}'),t={name:"guide/career/associations/shenzhen-international-ai.md"};function o(n,a,h,s,u,d){return e(),i("div",null,[...a[0]||(a[0]=[r('<h1 id="国际人工智能产业联盟深圳中心" tabindex="-1">国际人工智能产业联盟深圳中心 <a class="header-anchor" href="#国际人工智能产业联盟深圳中心" aria-label="Permalink to &quot;国际人工智能产业联盟深圳中心&quot;">​</a></h1><h2 id="协会简介" tabindex="-1">协会简介 <a class="header-anchor" href="#协会简介" aria-label="Permalink to &quot;协会简介&quot;">​</a></h2><p>国际人工智能产业联盟深圳中心于2024年12月26日在北大科创园正式揭牌。该联盟2023年在香港注册成立，致力于推动全球人工智能产业的快速发展，加速人工智能技术在各行各业的创新和应用。</p><h2 id="核心优势" tabindex="-1">核心优势 <a class="header-anchor" href="#核心优势" aria-label="Permalink to &quot;核心优势&quot;">​</a></h2><ul><li><strong>国际视野</strong>: 全球人工智能领域的866位院士/会士参与</li><li><strong>资源丰富</strong>: 45家社会组织、200家企业、101家国际院校/科研机构</li><li><strong>资本支持</strong>: 66家投融资机构以及9家咨询机构</li><li><strong>平台优势</strong>: 深圳中心位于北大科创园，拥有科技部和工信部双国家级资质</li></ul><h2 id="主要服务" tabindex="-1">主要服务 <a class="header-anchor" href="#主要服务" aria-label="Permalink to &quot;主要服务&quot;">​</a></h2><h3 id="国际合作" tabindex="-1">国际合作 <a class="header-anchor" href="#国际合作" aria-label="Permalink to &quot;国际合作&quot;">​</a></h3><ul><li>全球AI产业交流</li><li>国际技术合作</li><li>跨境项目对接</li><li>国际标准制定</li></ul><h3 id="技术交流" tabindex="-1">技术交流 <a class="header-anchor" href="#技术交流" aria-label="Permalink to &quot;技术交流&quot;">​</a></h3><ul><li>AI技术研讨会</li><li>国际学术会议</li><li>技术成果展示</li><li>创新应用推广</li></ul><h3 id="人才培养" tabindex="-1">人才培养 <a class="header-anchor" href="#人才培养" aria-label="Permalink to &quot;人才培养&quot;">​</a></h3><ul><li>国际AI工程师认证</li><li>专业技能培训</li><li>人才交流平台</li><li>校企合作项目</li></ul><h2 id="重点领域" tabindex="-1">重点领域 <a class="header-anchor" href="#重点领域" aria-label="Permalink to &quot;重点领域&quot;">​</a></h2><h3 id="人工智能技术" tabindex="-1">人工智能技术 <a class="header-anchor" href="#人工智能技术" aria-label="Permalink to &quot;人工智能技术&quot;">​</a></h3><ul><li>机器学习</li><li>深度学习</li><li>自然语言处理</li><li>计算机视觉</li></ul><h3 id="应用场景" tabindex="-1">应用场景 <a class="header-anchor" href="#应用场景" aria-label="Permalink to &quot;应用场景&quot;">​</a></h3><ul><li>智能制造</li><li>智慧医疗</li><li>智慧城市</li><li>金融服务</li></ul><h3 id="产业生态" tabindex="-1">产业生态 <a class="header-anchor" href="#产业生态" aria-label="Permalink to &quot;产业生态&quot;">​</a></h3><ul><li>AI+产业融合</li><li>技术产业化</li><li>商业模式创新</li><li>生态系统建设</li></ul><h2 id="组织架构" tabindex="-1">组织架构 <a class="header-anchor" href="#组织架构" aria-label="Permalink to &quot;组织架构&quot;">​</a></h2><h3 id="全球资源" tabindex="-1">全球资源 <a class="header-anchor" href="#全球资源" aria-label="Permalink to &quot;全球资源&quot;">​</a></h3><ul><li><strong>院士/会士</strong>: 866位全球AI领域顶尖专家</li><li><strong>社会组织</strong>: 45家国际AI组织</li><li><strong>企业会员</strong>: 200家AI相关企业</li><li><strong>院校机构</strong>: 101家国际院校/科研机构</li><li><strong>投资机构</strong>: 66家投融资机构</li><li><strong>咨询机构</strong>: 9家咨询机构</li></ul><h3 id="深圳中心" tabindex="-1">深圳中心 <a class="header-anchor" href="#深圳中心" aria-label="Permalink to &quot;深圳中心&quot;">​</a></h3><ul><li><strong>地理位置</strong>: 深圳市宝安区石岩湖畔的北大科创园</li><li><strong>平台资质</strong>: 科技部和工信部双国家级资质</li><li><strong>合作机构</strong>: 深圳市人工智能产业办公室</li><li><strong>服务对象</strong>: 深圳高科技企业</li></ul><h2 id="服务特色" tabindex="-1">服务特色 <a class="header-anchor" href="#服务特色" aria-label="Permalink to &quot;服务特色&quot;">​</a></h2><h3 id="ai-转型升级" tabindex="-1">AI+转型升级 <a class="header-anchor" href="#ai-转型升级" aria-label="Permalink to &quot;AI+转型升级&quot;">​</a></h3><ul><li>帮助企业实现AI+转型升级</li><li>提供AI技术解决方案</li><li>支持AI应用落地</li><li>推动AI产业发展</li></ul><h3 id="院士智库" tabindex="-1">院士智库 <a class="header-anchor" href="#院士智库" aria-label="Permalink to &quot;院士智库&quot;">​</a></h3><ul><li>打造AI+院士智库</li><li>提供专家咨询服务</li><li>支持技术研发</li><li>推动产业创新</li></ul><h3 id="国际合作-1" tabindex="-1">国际合作 <a class="header-anchor" href="#国际合作-1" aria-label="Permalink to &quot;国际合作&quot;">​</a></h3><ul><li>促进国际AI技术交流</li><li>支持跨境项目合作</li><li>推动国际标准制定</li><li>建设全球AI生态</li></ul><h2 id="联系方式" tabindex="-1">联系方式 <a class="header-anchor" href="#联系方式" aria-label="Permalink to &quot;联系方式&quot;">​</a></h2><ul><li><strong>官网</strong>: <a href="http://www.iaiia.org" target="_blank" rel="noreferrer">国际人工智能产业联盟</a></li><li><strong>地址</strong>: 深圳市宝安区石岩湖畔北大科创园</li><li><strong>电话</strong>: 0755-xxxx-xxxx</li><li><strong>邮箱</strong>: <a href="mailto:info@iaiia.org" target="_blank" rel="noreferrer">info@iaiia.org</a></li></ul><h2 id="加入条件" tabindex="-1">加入条件 <a class="header-anchor" href="#加入条件" aria-label="Permalink to &quot;加入条件&quot;">​</a></h2><h3 id="企业会员" tabindex="-1">企业会员 <a class="header-anchor" href="#企业会员" aria-label="Permalink to &quot;企业会员&quot;">​</a></h3><ul><li>AI相关企业</li><li>技术实力要求</li><li>国际化视野</li><li>遵守联盟章程</li></ul><h3 id="个人会员" tabindex="-1">个人会员 <a class="header-anchor" href="#个人会员" aria-label="Permalink to &quot;个人会员&quot;">​</a></h3><ul><li>AI领域专业人士</li><li>相关技术背景</li><li>认同联盟宗旨</li><li>按时缴纳会费</li></ul><h2 id="相关资源" tabindex="-1">相关资源 <a class="header-anchor" href="#相关资源" aria-label="Permalink to &quot;相关资源&quot;">​</a></h2><ul><li><a href="./international-ai-trends.html">国际AI技术发展趋势</a></li><li><a href="./international-ai-cooperation.html">国际合作机会</a></li><li><a href="./international-ai-talent.html">人才培养计划</a></li><li><a href="./international-ai-reports.html">行业研究报告</a></li></ul>',40)])])}const q=l(t,[["render",o]]);export{b as __pageData,q as default};
